import React from 'react';
import MinhaImagem from './imagens/golden.jpg';

function Home() {
    return (
        <div className="principal">
            <h3>Seja Bem-Vindo Ao PetShop</h3>
            <img src="golden-retriever.jpg" alt="Descrição da Imagem" />
        </div>
    );
}

export default Home;
